import { FaFacebookF, FaGoogle } from 'react-icons/fa'; 
import './welcome.css';
import { useNavigate } from 'react-router-dom';

const Welcome = () => {
    const navigate=useNavigate();
    const handle=()=>{
        navigate('/Signup')
    }
  return (
    <div>
        
      <div className='wel'>
      <h5>skip</h5>
        <div className='left'>
          <h1>Welcome to</h1>
          <p className='fod'>Food Hub</p>
          <p className='para'>Your favourite foods delivered<br></br>fast at your door.</p>
        </div>

        
        <div className='sign'>
          <p>------   Sign-in with   ------</p>
          <button > 

            <FaFacebookF className='icon' /> Facebook  </button>
          <button onClick={handleFacebookRedirect}><FaGoogle className='icons' /> Google  </button>
        </div>

       
        <div className='star'>
          <button className='st'>Start with email or phone</button>
          <p className='al'>Already have an account? 
         
           <a className='ref' href='' onClick={handle}> Sign-in</a></p>
        </div>
      </div>
    </div>
  );
};

export default Welcome;
